import React from "react";
import "../styles/Home.css"; // Import CSS file
import WallPaper from "../images/Home_WallPaper.png";
import { useNavigate } from "react-router-dom";

export default function Home() {
    function GameJoin(){
        const navigate = useNavigate();
        navigate('/join');


    }

    return (
        <div className="container text-center">
        <div>
            <h1 className="title">CLUEDO</h1>
        </div>
        <img className="img-fluid rounded shadow-sm" src={WallPaper} alt="WallPaper" />
        <button onClick={GameJoin} type="button" className="btn btn-outline-secondary my-2">Start Game</button>
        <footer className="text-body-secondary text-center text-small">
            <p className="mb-1">© 2023–2024 GameStar</p>
        </footer>
        </div>
    );
}
